// App.js
import React from 'react';
import TopNav from './TopNav';
import ReviewAudiences from './ReviewAudiences';

class App extends React.Component {
  render() {
    const houses = [
      {
        image: 'house1.jpg',
        address: '1105/442 Elizabeth Street, Melbourne, Vic 3000',
        type: 'Apartment',
      },
      {
        image: 'house2.jpg',
        address: '163 Albert Street, Port Melbourne, Vic 3207',
        type: 'Sharehouse',
      },
      {
        image: 'house3.jpg',
        address: '108/593 Elizabeth Street, Melbourne, Vic 3000',
        type: 'Student Accommodation',
      },
    ];

    return (
      <div>
        <TopNav />
        <div className="container mt-5">
          <h2>Welcome to Ranter!</h2>
          <p>
            Are you tired of struggling to find the perfect rental property? Look no further than
            Ranter! Our platform provides tenants with the most current and authentic reviews from
            previous renters, helping you find your ideal home. Say goodbye to the guesswork and
            frustration of the rental search process and say hello to the ease and convenience of
            Ranter!
          </p>
          <ReviewAudiences houses={houses} />
        </div>
      </div>
    );
  }
}

export default App;
